  font-weight: bold;
}
nav> ul.gnb>li>a:hover{
  background-color: salmon;
  color: #fff;
  border-radius: 5px;
  cursor: pointer;
  transition: all 0.5s;
}

nav.close{
  display: none;
  position: absolute;
  right: 35px; top: 35px;
  width: 35px; height: 35px;
